import "./App.css";
import CollegeList from "./components/CollegeList";
import FilterBar from "./components/FilterBar";
import { MuiThemeProvider, createTheme } from '@material-ui/core/styles';

const columns = [
  { id: "name", label: "Name", minWidth: 170 },
  { id: "age", label: "Age", minWidth: 100 },
];

const rows = [
  { name: "Naman Agrawal", age: 13 },
  { name: "Naman Agrawal", age: 13 },
];

const theme = createTheme({
  palette: {
    primary: {
      main: '#ff0000', // very red
    },
    default: {
      dark: '#000000',
      light: '#111111',
      main: '#100008',
      contrastText: '#ffffff',
    },
    secondary: {
      main: '#00fff0', // very cyan
    },
  }
});

function App() {
  return (
    <div className="App">
      <MuiThemeProvider theme={theme}>
        <FilterBar></FilterBar>
        <div className="list">
          <CollegeList list={rows} columns={columns}></CollegeList>
        </div>
      </MuiThemeProvider>
    </div>
  );
}

export default App;
